const MaskedInput = ({ value, onChange, name, mask }) => {
    function handleChange(event) {
      onChange({
        ...event,
        target: {
          ...event.target,
          name,
          value: onlyNumbers(event.target.value)
        }
      });
    }
  
    return (
      <InputMask
        name={name}
        mask={mask}
        value={value}
        onChange={handleChange}
      />
    );
  };
  
  export default MaskedInput;
